// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Proxy is Ownable {
    address public implementation; // Address of the implementation contract

    event Upgraded(address indexed newImplementation);

    constructor(address _implementation) Ownable(msg.sender) {
        require(_implementation != address(0), "Proxy: Invalid implementation address");
        implementation = _implementation;
    }

    // Upgrade to a new implementation contract
    function upgradeTo(address _newImplementation) external onlyOwner {
        require(_newImplementation != address(0), "Proxy: Invalid implementation address");
        implementation = _newImplementation;
        emit Upgraded(_newImplementation);
    }

    // Fallback function to delegate calls to the implementation contract
    fallback() external payable {
        _delegate(implementation);
    }

    // Receive function for handling ETH sent directly to the contract
    receive() external payable {
        _delegate(implementation);
    }

    // Internal function to delegate calls to the implementation contract
    function _delegate(address _implementation) internal {
        require(_implementation != address(0), "Proxy: Implementation not set");

        assembly {
            // Copy calldata (input data) to memory
            calldatacopy(0, 0, calldatasize())

            // Call the implementation contract with the same calldata
            let result := delegatecall(gas(), _implementation, 0, calldatasize(), 0, 0)

            // Copy the returned data to memory
            returndatacopy(0, 0, returndatasize())

            // Return or revert based on the delegatecall result
            switch result
            case 0 { revert(0, returndatasize()) }
            default { return(0, returndatasize()) }
        }
    }
}

